import React from "react";
import logo from "~/micranproj/public/logo.jpeg";


const Auth =()=>{

    return(

        <div className="classes.Auth" style={{display:"flex",justifyContent:"center",paddingTop:"100px",
        flexGrow:"1",width:"100%",backgroundColor:"#FFFF"}}>
            <div style={{width:"100%",maxWidth:"600px",padding:"0 20px"}}>

                <form style={{position:"absolute", width: "300px",height:"399px",
                left:"533px",top:"100px",background:"#eee",boxShadow:"2px 2px 2px rgba(0,0,0,.5)",padding:"15px",
                borderRadius:"5px"}}>
                        <img src={logo} alt="Микран"></img>
                        <h6>Логин</h6>
                        <input type="text" style={{width: "100%", padding:"5px 10px", boxSizing: "border-box"}}></input>
                        <h6>Пароль</h6>
                        <input type="text" style={{width: "100%", padding:"5px 10px", boxSizing: "border-box"}}></input>
                </form>
            </div>
        </div>
    )
}
export default Auth;
